import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div className="box-container">
      {/* Left side content */}
      <div className="box-left">
        <h1>Experience Live Shopping</h1>
        <p>
          Join our live shopping events and grab exclusive deals in real time.
          Enjoy interactive sessions, flash discounts, and exciting giveaways.
        </p>
        <button>Join Now</button>
      </div>

      {/* Right side image */}
      <div className="box-right">
        <img src="assets/Hero.png" alt="Live Shopping" />
      </div>
    </div>
  );
};

export default Home;
